import React from 'react';
import {FaSignInAlt} from "react-icons/all";
import {Link} from 'react-router-dom';

const HeaderComponent = () => {
	return (
		<header className={'header'}>
			<div className="logo">
				<Link to={'/'}>HOME</Link>
			</div>
		</header>
	);
};

export default HeaderComponent;
